<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Token Üretici</title>
    <link rel="stylesheet" href="styles.css">
</head>
<body>
    <style>
        body {
            background-color: #111;
            color: #fff;
            font-family: Arial, sans-serif;
            text-align: center;
            margin: 0;
            padding: 0;
            height: 100vh;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
        }
        
        .container {
            background-color: #222;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.5);
        }
        
        h1 {
            font-size: 24px;
            margin-bottom: 20px;
        }
        
        .token {
            font-size: 20px;
            margin-bottom: 20px;
        }
        
        .message-box {
            display: none;
            background-color: rgba(0, 123, 255, 0.8);
            color: #fff;
            padding: 10px;
            border-radius: 5px;
            position: fixed;
            top: 20px;
            left: 50%;
            transform: translateX(-50%);
            z-index: 999;
        }
        
        button {
            background-color: #007bff;
            color: #fff;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            font-size: 16px;
            cursor: pointer;
        }
        
        button:hover {
            background-color: #0056b3;
        }
        
    </style>
    <div class="container">
        <h3 >Bu tokeni kopyalayıp uygulamaya giriş yapabilirsiniz</h3>
        <div class="token" id="token-display">Token: <span id="token"></span></div>
        <button id="copy-button">Kopyala</button>
    </div>
    
    <!-- Mesaj kutusu için div -->
    <div class="message-box" id="message-box">
        Token kopyalandı: <span id="message-text"></span>
    </div>
